import React from 'react'
import { Navbar, NavLink, ToggleButton } from "react-bootstrap"

function Nav() {
    return (
       <Navbar expand="lg" bg="dark" >
        <Navbar.Toggle aria-controls="basic-navbar-nav" />


       </Navbar>
    )
}

export default Nav
